parameters.text:
=Analyze the following Airtable inventory records and return the optimized stock details.

Input Data:
{{ JSON.stringify($json, null, 2) }}

Return ONLY this JSON structure:

{
  "results": [
    {
      "id": "...",
      "ItemName": "...",
      "SKU": "...",
      "QuantityInStock": number,
      "ReorderLevel": number,
      "SuggestedReorderPoint": number,
      "SuggestedSafetyStock": number,
      "StockStatus": "OK | Needs Reorder | Critical"
    }
  ]
}

parameters.jsCode:
let items = $input.all();

// AI may return multiple partial outputs â†’ merge them
let mergedResults = [];

for (const item of items) {
  let out = item.json.output || item.json;

  // Remove backticks or markdown
  out = String(out).replace(/```json|```/g, '').trim();

  try {
    const parsed = JSON.parse(out);
    if (parsed?.results) {
      mergedResults.push(...parsed.results);
    }
  } catch (err) {
    // Skip invalid JSON
  }
}

return [
  {
    json: {
      results: mergedResults
    }
  }
];

